import UserItem from "../UserItem/UserItem";
import notFoundImage from "../../images/not-found-image.jpg";

const UserList = ({ users }) => {
    // users = [];
  const usersNotFound = !users;
  const usersEmpty = users.length === 0;
  const usersNotEmpty = users;

  return (
    <ul>
      {usersNotFound && <img src={notFoundImage} alt="" />}
      {usersEmpty && <h3>Now there are no users! Fill out the form and join us!</h3>}
      {usersNotEmpty &&
        users.map(({ id, email, name, phone, photo, position }) => (
          <UserItem
            key={id}
            email={email}
            name={name}
            phone={phone}
            photo={photo}
            position={position}
          />
        ))}
    </ul>
  );
};

export default UserList;
